  font-weight: normal;
  padding-right: 8px;
}
.ms-Icon--Completed:before {
  content: "\E930";
}
.ms-Icon--ErrorBadge:before {
  content: "\EA39";
}
.ms-Icon--Play:before {
  content: "\E768";
}
.ms-Icon--ProgressRingDots:before {
  content: "\F16A";
}
/* width */
::-webkit-scrollbar {
  background-color: transparent;
  height: 8px;
  width: 8px;
}
